import React, { useEffect, useState } from 'react';

const RosterPaymentsPage = () => {
  const [roster, setRoster] = useState([]);

  useEffect(() => {
    fetch('/data/roster.json')
      .then(res => res.json())
      .then(data => setRoster(data))
      .catch(err => {
        console.error('Error loading roster:', err);
        setRoster([]);
      });
  }, []);

  return (
    <div style={{ padding: '20px', maxWidth: '600px', margin: '0 auto' }}>
      <div style={{
        backgroundColor: '#003300',
        color: 'white',
        textAlign: 'center',
        padding: '12px',
        borderRadius: '10px',
        marginBottom: '20px',
        fontSize: '20px',
        fontWeight: 'bold'
      }}>
        üèà Players Roster
      </div>

      {roster.length === 0 ? (
        <p>No roster data available.</p>
      ) : (
        <div>
          {roster.map((player, idx) => (
            <div
              key={idx}
              style={{
                display: 'flex',
                alignItems: 'center',
                padding: '10px 14px',
                backgroundColor: idx % 2 === 0 ? '#f2f2f2' : '#e6ffe6',
                borderRadius: '6px',
                marginBottom: '8px'
              }}
            >
              <span style={{ fontSize: '18px', marginRight: '12px' }}>üèà</span>
              <span style={{ fontWeight: 'bold' }}>{player.GameName}</span>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default RosterPaymentsPage;
